import { Component } from 'react';
// Import Swiper React components
import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';

class SwiperComponent extends Component {



  render() {
    return (
      <Swiper
        spaceBetween={10}
        slidesPerView={3}
      >
        <SwiperSlide><img src='https://picsum.photos/id/1/200/300' /></SwiperSlide>
        <SwiperSlide><img src='https://picsum.photos/id/2/200/300' /></SwiperSlide>
        <SwiperSlide><img src='https://picsum.photos/id/3/200/300' /></SwiperSlide>
        <SwiperSlide><img src='https://picsum.photos/id/4/200/300' /></SwiperSlide>
        <SwiperSlide><img src='https://picsum.photos/id/5/200/300' /></SwiperSlide>
        <SwiperSlide><img src='https://picsum.photos/id/6/200/300' /></SwiperSlide>
        <SwiperSlide><img src='https://picsum.photos/id/7/200/300' /></SwiperSlide>

      </Swiper>
    );
  }
}

export default SwiperComponent;
